    const data = await response.json();

    console.log(data);
  };
  useEffect(() => {
    getItemsByCode('100');
  });
  return (
    <div className="App">
      <h1>corkboard</h1>
      <input placeholder="code..."></input>
      <button>Use Code!</button>
      <button>New Code!</button>
    </div>
  );
};

export default App;
